import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <div>
         <nav class="bg-indigo-700 shadow-lg">
        <div class="container mx-auto">
            <div class="sm:flex justify-between items-center">
                <a href="#" class="text-white text-2xl font-bold p-3 mr-4"><i class="fas fa-mobile-android-alt"></i> SmartPhone Corner</a>

                <button class="text-white sm:hidden focus:outline-none">
                    <i class="fas fa-bars"></i>
                </button>

                <ul class="text-gray-300 sm:flex sm:self-center text-1xl border-t sm:border-none font-sans mt-4 sm:mt-0 hidden">
                    <li class="sm:inline-block">
                        <a href="/" class="p-3 hover:text-white"><i class="fa fa-home" aria-hidden="true"></i> HOME</a>
                    </li>
                    <li class="sm:inline-block">
                        <a href="/product" class="p-3 hover:text-white"><i class="fa fa-shopping-cart" aria-hidden="true"></i> PRODUCTS</a>
                    </li>
                    <li class="sm:inline-block">
                        <Link to="/about" class="p-3 hover:text-white"><i class="fa fa-address-card" aria-hidden="true"></i> ABOUT</Link>
                    </li>
                </ul>
            </div>
        </div>
    </nav>

    </div>
      );
};

export default Nav;
